tweet:
@nickhasthoughts Oof, gut punch here. I never realized how few women are in my music collection.

I even have Ryan Adams' 1989, but not Taylor's.

Oof.

@zoiqt Even with CDJs I would go all network/USB these days. Like who even burns CD-Rs these days?
With the digital formats you also can prepare loops and cues which I find important for gigs.
With Traktor things are nice and easy in that regard, import your music collection and go.

@roonlabs was included in @pitchfork's guide to building your own Digital Music Collection!

"Another library software option popular with aesthetes and audiophiles is Roon...designed to live at the heart of a whole-home audio setup."

Read more here https://t.co/8QunFomWbi https://t.co/5eUdBKPZp4

@varadadya I valued my music collection the most. Would painstakingly note down all the songs and get them recorded in Sony's 90 minutes cassette.
I also became an expert at repairing cassettes and cleaning the tape recorder.
Good old days

@MercanDede @LudovicoEinaud @hello_ouchhh https://t.co/bWAAkVIUYE
